INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "青空の下で謁見", 40, 2, 7, 5118061, 1, 2834, "フリーマーケット会場", 0, 8, 10118, "ペコリーヌとの出会い", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "未来の騎空団\nマスコット？", 40, 2, 7, 5118062, 1, 2835, "フリーマーケット会場", 0, 8, 10118, "マホとの出会い", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "お嬢さまからの\n緊急依頼", 40, 2, 7, 5118063, 1, 2837, "ランドソル市街地", 0, 8, 10118, "アキノとの出会い", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "黄金色の悩みごと", 40, 2, 18, 5118064, 1, 4108402, "フリーマーケット会場", 0, 8, 10118, "ジュンとの出会い", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "白熱！　格闘大会！", 40, 2, 18, 5118065, 1, 4107402, "フリーマーケット会場", 0, 8, 10118, "カオリとの出会い", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "祭り太鼓はオーエドの華", 40, 2, 16, 5118066, 1, 9000227, "オーエド町", 1, 8, 10118, "ニノンとの出会い", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "人気者は遅れて\nやってくる", 40, 3, 19, 5118067, 1, 2101181, "フリーマーケット会場", 0, 8, 10118, "スズナとの出会い", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "巫女・ミーツ・魔法少女", 40, 3, 18, 5118068, 1, 4109402, "ランドソル市街地", 0, 8, 10118, "ナナカとの出会い", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "ネズ耳は二度なくなる", 40, 3, 18, 5118069, 1, 4305402, "フリーマーケット会場", 0, 8, 10118, "キャル＆コッコロとの出会い", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "この出会いにカンパイ！", 40, 3, 18, 5118070, 1, 4101402, "ランドソル市街地", 0, 8, 10118, "ユカリとの出会い", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "陰陽アンサンブル", 40, 3, 18, 5118071, 1, 4106402, "ランドソル市街地", 0, 8, 10118, "アオイとの出会い", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "運試し十番勝負！", 40, 3, 7, 5118072, 1, 2836, "フリーマーケット会場", 1, 8, 10118, "シノブとの出会い", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "彼女たちの新たな日常", 0, 1, 0, 5118600, 0, 0, 0, 0, 0, 10118, "オープニング", 0, 0);
